import axios from "axios";
import react,{ useEffect,useState } from "react";
import { useParams } from "react-router-dom";

const CasasDetail = () => {
    const urlCasasDetail = 'https://api.got.show/api/show/houses'
    const [CasasDetail, setCasasDetail] = useState ({});
    let {id} = useParams();
    useEffect (() => {
        const getCasasDetail = async () =>{
            const res = await axios.get (urlCasasDetail+'/'+_id)
            setCasasDetail(res.data)

        }
        getCasasDetail()
    },[])
    console.log(CasasDetail)
    return (<div>
    <img src={CasasDetail.logoURL} alt={CasasDetail.logoURL}/>
    <h3>{CasasDetail.name}</h3>
<h5>{CasasDetail.seat}</h5>
<h5>{CasasDetail.allegiance}</h5>
<h5>{CasasDetail.region}</h5>
<h5>{CasasDetail.religion}</h5>
<h5>{CasasDetail.sigil}</h5>
<h5>{CasasDetail.words}</h5>
    </div>)
}





export default CasasDetail
